import Link from 'next/link';
import Layout from '../components/MyLayout';

const PostLink = props => (
    <li>
        <Link href="/p/[id]" as={`/p/${props.id}`}>
            <a>{props.id}</a>
        </Link>
    </li>
);

export default function Index() {
    return (
        <Layout>
            <h1>The Mad Men unofficial Blog</h1>
            <ul>
                <PostLink id="Episodes" />
                <PostLink id="Cast" />
                <PostLink id="Crew" />
            </ul>
        </Layout>
    );
}
